import { useState } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import Navbar from '../Navbar/Navbar'; // Corrected import path
import styles from "./styles.module.css";
import emailjs from "@emailjs/browser";

const Unit = () => {
  const [data, setData] = useState({
    type: '', language: '', projectName: '', status: 'Pending',
  });
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const handleChange = ({ currentTarget: input }) => {
    setData({ ...data, [input.name]: input.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const url = `http://localhost:3001/api/unittests`;
      const { data: res } = await axios.post(url, data);

      emailjs
        .send("service_061uyjc", "template_qejy7ja", {
          to_email: data.email,
        }, "Ac1RL4TgJZVZgpMSY")
        .then((result) => {
          console.log(result.text);
        }, (error) => {
          console.log(error.text);
        });

      navigate("/HomePageWoker");
      console.log(res.message);
    } catch (error) {
      if (error.response && error.response.status >= 400 && error.response.status <= 500) {
        setError(error.response.data.message);
      }
    }
  };

  return (
    <div>
      <Navbar /> {/* Ensure the Navbar component is included */}
      <div className={styles.signup_container}>
        <div className={styles.signup_form_container}>
          <div className={styles.left}>
            <h1 style={{ color: '#a7cab1' }}>Welcome Back</h1>
            <Link to="/HomePageWoker">
              <button type="button" className={styles.white_btn}>
                HomePageWoker
              </button>
            </Link>
          </div>
          <div className={styles.right}>
            <form className={styles.form_container} onSubmit={handleSubmit}>
              <h1 style={{ color: '#a7cab1' }}>Create Account</h1>
              <input
                type="text"
                placeholder="Unit Test Type"
                name="type"
                onChange={handleChange}
                value={data.type}
                required
                className={styles.input}
              />
              <input
                type="text"
                placeholder="Project Name"
                name="projectName"
                onChange={handleChange}
                value={data.projectName}
                required
                className={styles.input}
              />
              <select
                name="language"
                onChange={handleChange}
                value={data.language}
                required
                className={styles.input}
              >
                <option value="Java">Java</option>
                <option value="Python">Python</option>
              </select>
              {error && <div className={styles.error_msg}>{error}</div>}
              <button type="submit" className={styles.green_btn}>
                Save
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Unit;
